import './App.css';
import guide1 from './Assets/Guide1.png';
import guide2 from './Assets/Guide2.png';
import guide3 from './Assets/Guide3.png';
function App() {
  return (
    <div className="App">
      {/* <img src={homepage} className="home-Image"></img> */}
      <img src={guide1} className="guides" />
      <img src={guide2} className="guides" />
      <img src={guide3} className="guides" />
    </div >
  );
}
export default App;
